mapper.select:

select 

from SYSCOMTEMPLATEMEMBERS
where TEMPLATEID = #{templateid,jdbcType=INTEGER}
  and POLICYID = #{policyid,jdbcType=INTEGER}

mapper.delete:

delete from SYSCOMTEMPLATEMEMBERS
where TEMPLATEID = #{templateid,jdbcType=INTEGER}
  and POLICYID = #{policyid,jdbcType=INTEGER}

mapper.update:

update SYSCOMTEMPLATEMEMBERS
set POLICYVALUE = #{policyvalue,jdbcType=VARCHAR},
  EFFECTDATE = #{effectdate,jdbcType=TIMESTAMP},
  EXPIREDDATE = #{expireddate,jdbcType=TIMESTAMP},
  UPDATEUSERID = #{updateuserid,jdbcType=INTEGER},
  UPDATETIME = #{updatetime,jdbcType=TIMESTAMP}
where TEMPLATEID = #{templateid,jdbcType=INTEGER}
  and POLICYID = #{policyid,jdbcType=INTEGER}
